【商品説明】<br>1 本で家中どこでも使えるクリーナー。１本で洗浄＆除菌！<br>キッチンの油汚れや食べこぼし、ドアノブの手あか、リビングのヤニ汚れなど家中の汚れを落とします。<br>天然発酵アルコールとアルカリ電解水で洗浄＆除菌。<br>2度拭き不要で、ベタつきも残りません。<br><br>商品サイズ：89×200×55<br><br>効能・効果：●天然発酵アルコールとアルカリ電解水で洗浄＆除菌。<br><br>成分：発酵エタノール、アルカリ電解水（40％）、グレープフルーツ種子エキス（天然抗菌成分）<br><br>ご使用上の注意等：●用途以外に使用しない。<br>●スプレー後拭き取らないまま長時間放置しない。<br>●換気に注意する。<br>●引火のおそれがあるので火気の付近で使用しない。<br>●ガス警報器が作動することがあるので注意する。<br><br>●小児の手の届く所、日のあたる所、高温になる所には置かない。<br><br>賞味期限等：無し<br><br>原産国：日本<br><br>問い合わせ先：〒101－8606 東京都千代田区神田美倉町11 フマキラー株式会社お客様相談室 電話番号0077－788－555<br>商品区分：その他掃除用品<br>JANコード：4902424433876<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
