【商品説明】<br>●　エタノールはお酒の成分と同じで、広く食用に使われているアルコールです。除菌・防カビ・消臭に効果を発揮します。　＜ｂｒ＞●　さとうきびを主原料としたアルコールを使用しています。　＜ｂｒ＞●　食品にかかっても心配ありません<br>使用方法用途など：<BR>●　除菌／包丁、まな板などの調理器具、フキン、食器、食器棚、食卓、冷蔵庫内、ゴムパッキン、ヘアブラシ、電話器など　＜ｂｒ＞●　除カビ／タタミ、浴室、洗面所、押し入れなど　＜ｂｒ＞●　消臭／生ゴミ、三角コーナー、流し台、ゴミ受け、げた箱など<br><br>成分：<BR>エチルアルコール６５ｖ／ｖ％、精製水３４．５％、、乳酸等０．５％<br>使用上の注意：<BR>人体や食品にかかっても心配はありませんが、飲んだり人体に使用しないでください。レンジ・湯沸かし器など火気の付近では使用しないでください。<br>応急処置：<BR>万一目に入った場合は、水ですぐ洗い流して医師に相談してください。<br>保管保存方法：<BR>火気のない涼しいところに保管し、40度以上になる所には置かないでください。<br><br>賞味期限等：<BR>無<br>問い合わせ先：<BR>株式会社アサヒペン 〒538-8666 大阪府大阪市鶴見区4-1-12 06-6934-0300※お電話でのお問い合わせの受付時間  9：00～17：00（土日祝、年末年始、夏期休暇期間をのぞく）<br>原産国：日本<br>ブランド：<BR>商品サイズ：77×177×40<br>JANコード：4970925301970<BR>cs：48<BR>商品カテゴリ： 台所洗剤　＞　漂白･殺菌　＞　キッチン用アルコール除菌　(220201)<BR><br>使用方法用途など：●　除菌／包丁、まな板などの調理器具、フキン、食器、食器棚、食卓、冷蔵庫内、ゴムパッキン、ヘアブラシ、電話器など　＜ｂｒ＞●　除カビ／タタミ、浴室、洗面所、押し入れなど　＜ｂｒ＞●　消臭／生ゴミ、三角コーナー、流し台、ゴミ受け、げた箱など<br><br>成分：エチルアルコール６５ｖ／ｖ％、精製水３４．５％、、乳酸等０．５％<br>使用上の注意：人体や食品にかかっても心配はありませんが、飲んだり人体に使用しないでください。レンジ・湯沸かし器など火気の付近では使用しないでください。<br>応急処置：万一目に入った場合は、水ですぐ洗い流して医師に相談してください。<br>保管保存方法：火気のない涼しいところに保管し、40度以上になる所には置かないでください。<br><br>賞味期限等：無<br>問い合わせ先：株式会社アサヒペン 〒538-8666 大阪府大阪市鶴見区4-1-12 06-6934-0300※お電話でのお問い合わせの受付時間  9：00～17：00（土日祝、年末年始、夏期休暇期間をのぞく）<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
