サフロン バイオレットの香り 詰替 1.1L<br>ブランド：サフロン<br>販売・製造元：LGジャパン<br><br>香りを包んだカプセルがはじけて香りが長続きする柔軟剤です。<br>サフロンで仕上げた後、繊維に香りのカプセルが付着し、着ている時に動くたびにはじけだし、バイオレットの香りをお届けします。<br>香りが違うと服だけでなく、生活も楽しく変えられるという期待感が高まります。<br>日常生活で起こる楽しいエピソードが生活のアクセントに。<br>  <br>用途衣類品用(綿、毛、化学せんい等) 使用量の目安水1Lに0.33ml <br><br>使用上の注意<br>・用途以外に使わない。<br>・子供の手の届くところに置かない。<br>・柔軟仕上げ剤の自動投入口を使う場合は、洗濯機の取扱い説明書をお読み下さい。<br>・原液が直接衣類にかからないようにする。<br>*応急処置*・目に入ったときは、こすらずにすぐ流水で15分以上洗い流し、眼科医に相談する。<br>受診時は商品を持参する。<br>・飲みこんだ時は吐かずにすぐ口をすすぎ、水か牛乳を飲む等の処置をする。<br> 詰め替え方他の製品と混ぜると変質することがあります。<br>ボトルは洗ってからお詰め下さい。<br> <br>成分<br>界面活性剤(エステル型ジアルキルアンモニウム塩)、抗菌剤 柔軟剤とは柔軟剤は、洗濯後の衣類の静電気を防止し、ふんわりとした柔軟性を与えるための仕上げ剤です。<br>香りが長く続く柔軟剤、防臭タイプの柔軟剤、乾燥機専用の柔軟剤シートなどが揃っています。<br><br>日用品／洗濯用品／柔軟剤/静電気・シワ対策／柔軟剤 詰替用<br>JANコード： 4985275795058<br><br>CS：10<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
