「アースレッド お風呂の防カビスプレー ピンクヌメリ予防プラス ローズの香り 400ml」は、週に1回スプレーするだけで、黒カビ・ピンクヌメリのお掃除回数が減る防カビスプレーです。スプレーするだけで濡れている所でも、汚れている所でも、有効成分IPMPが浸透してしっかり除菌。黒カビやピンクヌメリの発生を防ぎます。<br />※本品はカビとり剤、ピンクヌメリ除去剤ではありません。本品は黒カビやピンクヌメリを落とす効果はありません。黒カビやピンクヌメリを生えにくくする商品です。<br /><br />使用方法<br /><br />浴室内の黒カビやピンクヌメリが発生しやすい場所に、週に1回約20cm離れたところから全体が均一に濡れる程度に噴霧してください。使用後の拭き取りや水洗いは不要です。<br />●はじめて：効果を高めるため、目立つ黒カビやピンクヌメリがある場合は黒カビやピンクヌメリを取り除いてから使用してください。<br />●2回目以降：1週間に1回使用することで、黒カビやピンクヌメリが予防でき、使い続けている期間は黒カビやピンクヌメリのお掃除は不要です。<br />※排水口や浴槽の溝など、黒カビやピンクヌメリが特に気になる部分にはしっかりと処理してください。<br />※浴室内の温度や湿度などの使用環境により効果は異なります。<br /><br />【使えないもの】<br />真鍮(装飾金具など)、ポリスチレン(透明なプラスチック製の棚など)<br />※透明なプラスチック素材に使用する場合は、目立たない所で影響がないことを確認してから使用する。<br /><br />使用上の注意<br /><br />●用途外に使わない。<br />●子供の手の届くところに置かない。<br />●必ず「OFF」で保管する。<br />●「OFF」にしたままスプレーしない。<br />●換気をよくして使う。<br />●噴霧気体を吸入しない。<br />●アルコールに弱い人、アレルギー症状やかぶれなどを起こしやすい体質の人は噴霧に触れたり、吸い込まないようにする。<br />●容器を横向きや逆さまにして使用しない。<br />●吸入したり目に入ったりしないように注意する。<br />●引火のおそれがあるので火気の付近では使用しない。<br />※大量にかけるとまれに白くなることがありますが、水で洗えばきれいになります。<br />※変色したり、はげたりすることがあるので、材質が不明な場合や塗装面に使用する場合には、必ず目立たない所で試してからご使用ください。<br /><br />応急処置<br /><br />●目に入ったときはこすらずすぐ水で十分に洗い流す。<br />●飲み込んだときは水を飲む等の処置をする。<br />●異常がある時は商品を持参し、医師に相談する。<br /><br />品質表示<br /><br />●液性：中性<br />●成分：イソプロピルメチルフェノール(IPMP)、エタノール、香料<br /><br />お問い合わせ先<br /><br />アース製薬株式会社 お客様窓口<br />TEL：0120-81-6456<br /><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
